import { Pet } from '../types';

// Fetch pets from the Grow a Garden API
const fetchPetsFromAPI = async (): Promise<Pet[]> => {
  try {
    const response = await fetch('https://api.joshlei.com/v2/growagarden/info/');
    const data = await response.json();

    if (data && data.pets) {
      return data.pets.map((pet: any) => ({
        id: pet.id || pet.name,
        name: pet.name,
        rarity: pet.rarity || 'Common',
        image: pet.image || 'üêæ',
        probability: pet.probability || 0.1,
        description: pet.description || `A ${pet.rarity || 'Common'} pet from Grow a Garden`
      }));
    }

    return [];
  } catch (error) {
    console.error('Error fetching pets from API:', error);
    return getFallbackPets();
  }
};

// Fallback pets in case API fails
const getFallbackPets = (): Pet[] => [
  // Common pets (40% probability)
  { id: '1', name: 'Common Cat', rarity: 'Common', image: 'üê±', probability: 0.4, description: 'A friendly common cat' },
  { id: '2', name: 'Common Dog', rarity: 'Common', image: 'üêï', probability: 0.4, description: 'A loyal common dog' },
  { id: '3', name: 'Common Bird', rarity: 'Common', image: 'üê¶', probability: 0.4, description: 'A cheerful common bird' },
  { id: '4', name: 'Common Fish', rarity: 'Common', image: 'üê†', probability: 0.4, description: 'A swimming common fish' },

  // Uncommon pets (25% probability)
  { id: '5', name: 'Uncommon Fox', rarity: 'Uncommon', image: 'ü¶ä', probability: 0.25, description: 'A clever uncommon fox' },
  { id: '6', name: 'Uncommon Rabbit', rarity: 'Uncommon', image: 'üê∞', probability: 0.25, description: 'A quick uncommon rabbit' },
  { id: '7', name: 'Uncommon Bear', rarity: 'Uncommon', image: 'üêª', probability: 0.25, description: 'A strong uncommon bear' },
  { id: '8', name: 'Uncommon Deer', rarity: 'Uncommon', image: 'ü¶å', probability: 0.25, description: 'A graceful uncommon deer' },

  // Rare pets (20% probability)
  { id: '9', name: 'Rare Dragon', rarity: 'Rare', image: 'üêâ', probability: 0.2, description: 'A powerful rare dragon' },
  { id: '10', name: 'Rare Phoenix', rarity: 'Rare', image: 'ü¶Ö', probability: 0.2, description: 'A majestic rare phoenix' },
  { id: '11', name: 'Rare Unicorn', rarity: 'Rare', image: 'ü¶Ñ', probability: 0.2, description: 'A magical rare unicorn' },
  { id: '12', name: 'Rare Griffin', rarity: 'Rare', image: 'ü¶Å', probability: 0.2, description: 'A noble rare griffin' },

  // Legendary pets (10% probability)
  { id: '13', name: 'Legendary Leviathan', rarity: 'Legendary', image: 'üêã', probability: 0.1, description: 'A massive legendary leviathan' },
  { id: '14', name: 'Legendary Kraken', rarity: 'Legendary', image: 'ü¶ë', probability: 0.1, description: 'A fearsome legendary kraken' },
  { id: '15', name: 'Legendary Hydra', rarity: 'Legendary', image: 'üêç', probability: 0.1, description: 'A multi-headed legendary hydra' },

  // Mythical pets (3% probability)
  { id: '16', name: 'Mythical Celestial', rarity: 'Mythical', image: '‚≠ê', probability: 0.03, description: 'A divine mythical celestial being' },
  { id: '17', name: 'Mythical Void', rarity: 'Mythical', image: 'üåå', probability: 0.03, description: 'An enigmatic mythical void creature' },

  // Divine pets (1.5% probability)
  { id: '18', name: 'Divine Guardian', rarity: 'Divine', image: 'üëº', probability: 0.015, description: 'A sacred divine guardian' },
  { id: '19', name: 'Divine Seraph', rarity: 'Divine', image: 'üòá', probability: 0.015, description: 'A holy divine seraph' },

  // Prismatic pets (0.5% probability)
  { id: '20', name: 'Prismatic Crystal', rarity: 'Prismatic', image: 'üíé', probability: 0.005, description: 'A rare prismatic crystal entity' }
];

// Cache for API pets
let cachedPets: Pet[] | null = null;

export const getPetsFromAPI = async (): Promise<Pet[]> => {
  if (cachedPets) {
    return cachedPets;
  }

  cachedPets = await fetchPetsFromAPI();
  return cachedPets;
};

export const getRandomPets = (count: number): Pet[] => {
  // Use cached pets if available, otherwise use fallback
  const pets = cachedPets || getFallbackPets();

  const result: Pet[] = [];
  const usedIndices = new Set<number>();

  for (let i = 0; i < count; i++) {
    let attempts = 0;
    let selectedPet: Pet;

    do {
      // Weighted random selection based on probability
      const random = Math.random();
      let cumulativeProbability = 0;
      let selectedIndex = 0;

      for (let j = 0; j < pets.length; j++) {
        cumulativeProbability += pets[j].probability;
        if (random <= cumulativeProbability) {
          selectedIndex = j;
          break;
        }
      }

      selectedPet = pets[selectedIndex];
      attempts++;
    } while (usedIndices.has(selectedPet.id) && attempts < 100);

    if (attempts >= 100) {
      // If we can't find a unique pet, just pick any random one
      selectedPet = pets[Math.floor(Math.random() * pets.length)];
    }

    result.push(selectedPet);
    usedIndices.add(selectedPet.id);
  }

  return result;
};

// Initialize pets on app start
export const initializePets = async (): Promise<void> => {
  try {
    await getPetsFromAPI();
  } catch (error) {
    console.error('Failed to initialize pets from API:', error);
  }
};
